well, im still happy~ and yesterday was great...haha connie, masako, margo and v were like "why is nicole acting that way" and i probably scared issy....hehee yea i was hyper and happy at the same time...that's a bad thing but apparently it was a good thing for me to smile and laugh~ so i will take ppl's advice and be in better moods~~ ^.^; 

well, the past few days have been great and i wish it goes on like this for the rest of the year!met so many great people at church and have become to know who i really am! i love it here in ny and i know i belong in this city! hehee 

also the weird thing is that all the work that i have to do hasn't been bothering me at all. i know i need to do it but it doesn't make me nervous and stressed! i love that! hehee someone up there loves me~~ hehehee anyways gotta study~ =)
